import "./styles.scss";

const Home = ({menu, view}) => {
  return (
    <article id="home" title = "home">
        <div id="info">
            <div className="title">Rohit Naidu</div>
          <div id="socials">
            <a href="https://github.com/rohtett/" target="_blank">
              <div className="github" />
            </a>
            <a href="https://www.linkedin.com/in/rohtett/" target="_blank">
              <div className="linkedin" />
            </a>
          </div>
          <article>
            Front-end React developer with an interest in creating functional and responsive web apps with the latest practices and technologies. Looking to gain experience in Junior Web Development opportunities.
          </article>
          <div></div>
        </div>
        <nav
          onMouseEnter = { (event) => {
            event.target.firstChild.innerHTML=menu[view+1].at(0).toUpperCase()+menu[view+1].slice(1,menu[view+1].length)
            console.log(event.target.firstChild.node)
          }}
          onMouseLeave = {(event) => {
            event.target.firstChild.innerHTML=menu[view].at(0).toUpperCase()+menu[view].slice(1,menu[view].length)
          }}
        ><span>{menu[view].at(0).toUpperCase()+menu[view].slice(1,menu[view].length)}</span>
          <div class="arrow">
            <div />
            <div />
          </div>
        </nav>
    </article>
  )
}

export default Home;
